import { useEffect, useState } from "react";
import "./posts.css";
import { Link } from "react-router-dom";
function Posts() {
  const [posts, setPosts] = useState([]);
  useEffect(() => {
    fetch("/contents/postList.json")
      .then((response) => response.json())
      .then((data) => setPosts(data))
      .catch((error) => console.error("Error loading posts:", error));
  }, []);

  return (
    <div className="posts-container">
      {posts}
      {posts.map((post) => (
        <Link to={`/posts/${post.id}`} className="post-container" key={post.id}>
          <h1>{post.title}</h1>
          <h2>{post.description}</h2>
        </Link>
      ))}
      <li>
        <Link to="/posts/1" className="post-container">
          <h1>백베콘을 아시나요?1</h1>
          <h2>dddd</h2>
        </Link>
        <Link to="/posts/2" className="post-container">
          <h1>백베콘을 아시나요?2</h1>
          <h2>dddd</h2>
        </Link>
        <Link to="/posts/3" className="post-container">
          <h1>백베콘을 아시나요?3</h1>
          <h2>dddd</h2>
        </Link>
      </li>
    </div>
  );
}

export default Posts;
